import React, { useState } from 'react'
import { createContext } from 'react'
import Main from './Main'

const Properties = createContext()

const App = () => {

const [count, setcount] = useState(5)
  return (
   
    <div className='app'>
       <Properties.Provider value={{count:count}}>
        <Main/>
       </Properties.Provider>
    </div>
  )
}

export default App
export {Properties};
